import React from 'react';

interface ToolbarProps {
  onExport?: () => void;
  onImport?: () => void;
}

const Toolbar: React.FC<ToolbarProps> = ({ onExport, onImport }) => {
  return (
    <div className="toolbar" style={{
      display: 'flex',
      justifyContent: 'space-between',
      padding: '10px 15px',
      backgroundColor: '#000000ff',
      borderBottom: '0px solid #333',
    }}>
      <div style={{ display: 'flex', alignItems: 'center' }}>
        <h2 style={{ margin: 0, fontSize: '18px', color: '#fff' }}>DragFlow NN Builder</h2>
      </div>

      <div style={{ display: 'flex', gap: '10px' }}>
        {/* Import button */}
        <button 
          onClick={onImport}
          style={{
            backgroundColor: '#ffffffff',
            color: 'white',
            border: 'none',
            padding: '8px 16px',
            borderRadius: '4px',
            cursor: 'pointer',
            display: 'flex',
            alignItems: 'center',
            gap: '5px',
            fontWeight: 'bold'
          }}
        >
          <span>Import Model</span>
        </button>

        {/* Export button */}
        <button 
          onClick={onExport}
          style={{
            backgroundColor: '#4CAF50',
            color: 'white',
            border: 'none',
            padding: '8px 16px',
            borderRadius: '4px',
            cursor: 'pointer',
            display: 'flex',
            alignItems: 'center',
            gap: '5px',
            fontWeight: 'bold'
          }}
        >
          <span>Export Model</span>
        </button>
      </div>
    </div>
  );
};

export default Toolbar;
